import * as React from "react";
import "./App.css";
import AOS from 'aos'

import Header from './components/Header'
import Photothingy from './components/Photothingy'
import RegistrationForm from './components/RegistrationForm'

const photoThingData = require('./staticData/photoThingy')


function App() {
  // App component that provides initial context values
  // Here we are overwritting the context to be "dark" using the Provider
  AOS.init()
  return (
    <>
      <Header/>
      <div className="container">
        <div className="row">
          <div className="lg-col-12">
          {photoThingData && photoThingData.map((item, i) => {
            return <Photothingy
              key={i}
              item={item.classname}
              aosAction={item.aosAction}
              captions={item.captions}
            />
          })}
          </div>
        </div>
      </div>
      <div className="bg-image img2">
        <div id="login">
          <div className="container" data-aos="fade-left">
            <div className="row">
              <div className="lg-col-6">
                <RegistrationForm/>
              </div>
            </div>
            <div className="row">
              <div className="lg-col-6">

              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}


export default App;
